import "./App.css";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate,
} from "react-router-dom";

import Header from "./components/Header";

import LandingPage from "./components/LandingPage";
function App() {
  return (
    <>
      <div className="App">
        <Router>
          <Header />
          <Switch>
            <Route path="/" exact component={<LandingPage />} />
          </Switch>
        </Router>
        <Router>
          <Routes>
            <Route
              path="/"
              element={
                <>
                  <Header />
                  <LandingPage />
                </>
              }
            />
          </Routes>
        </Router>

        <div className="Footer"></div>
      </div>
    </>
  );
}

export default App;
